const AdminDashboard = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold">Panel de Administración</h1>
      <p className="mt-2 text-gray-600">Aquí podrás gestionar usuarios, productos, etc.</p>
    </div>
  );
};

export default AdminDashboard;
